style.css:
@-moz-document regexp("^https?:\/\/leosight\.cz(.*)$") {
  body {
    background: #fce1da url("https://64.media.tumblr.com/22422ea9c5108ccfb660ab4ec8d26560/tumblr_p5crgd9Z2X1w9xu55o1_1280.jpg") center center/250px repeat Fixed;
  }

  img[alt="LeoSight.cz"] {
    content: url(https://i.imgur.com/I4WY42t.png);
  }
	
  .menu a:hover {
		background: #e50144 !important;
  }

	.ddown-content a {
		background: #f03e73 !important;
    border-top: 1px solid #ff5f95 !important;
    color: #b20011 !important;
  }
	
	.ddown-content a:hover {
    color: #FFF;
    background: #e50144 !important;
	}

  .ddown-content hr {
    padding: 1px 0;
    margin: 0;
    color: #f03e73 !important;
    background: #f03e73 !important;
    border-color: #f03e73 !important;
  }

  .menu a:hover, .ddown:hover .ddown-button{
    color: #FFF;
    background: #e50144 !important;
  }
	
  .btn-donate:hover{
    background: #f03e73 !important;
  }

  .lista .progress {
    background: rgb(240 62 115) !important;
  }

  .up-button {
    background: #e50144 !important;
    border-top: 1px solid #f03e73 !important;
  }

  .up-button:hover {
		background: #f03e73 !important;
	}

  .achead {
    background: #e50144 !important;
    border-top: 3px solid #f03e73 !important;
  }

  .btn-donate {
    background: #e50144 !important;
  }

  .donation-bar > div {
    background-color: #e50144 !important;
  }
	
  .servers {
		border-bottom: 2px solid #e50144 !important;
  }
	
  .inner {
    border-bottom: 5px solid #e50144 !important;
  }

  footer a {
    color: #e50144 !important;
  }

  footer {
    color: #000 !important;
  }
}
